import * as React from 'react';
import { Grid, TextField, Typography, Button } from '@mui/material';
import aplogo from '../data/aplogo.png';
import { Link } from 'react-router-dom';
import "./layout.css";
import { Container } from '@mui/system';
//import { useNavigate } from "react-router-dom";

export default function SignUpIndexV2(){
    //const navigate = useNavigate();

    const [values, setValues] = React.useState({
        id: "",
        password: "",
        name: ""
    });

    const handleChange = (event) => {
        const { name, value } = event.target;
        setValues({
            ...values,
            [name]:value
        });
    }

    return (
    <Container component="main" maxWidth>
        <Grid container sx={{borderBottom: 1, borderBottomColor: 'grey.500'}}>
            <Grid item xs>
                <img class="image" src={aplogo} alt=' ' />
            </Grid>

            <Grid item>
                <Link to="/">로그인</Link>
                 <sapn>  |  </sapn>
                <Link to="/r2">회원가입 </Link>
            </Grid>
        </Grid>

        <Grid
        id="아이콘 및 큰 제목"
        container
        sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: "center",}}
        >
            <img src={aplogo} alt="  "/>
        <Typography variant="h5" component="h5">회원가입</Typography>
        </Grid>

        <Container
        id="군번 및 비밀번호 입력"
        maxWidth="sm"
        sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: "center"
        }}
        >
            <TextField
            margin="normal"
            label="군번" 
            required 
            name="id"
            autoFocus
            onChange={handleChange} 
            variant="standard"
            fullWidth
            sx={{marginTop: 8}}
            />

            <TextField
            margin="normal"
            label="비밀번호" 
            //type="password" 
            required 
            fullWidth
            name="password"
            autoComplete="current-password" 
            onChange={handleChange} 
            variant="standard"
            />

            <TextField
            margin="normal"
            label="이름" 
            required 
            name="name"
            onChange={handleChange} 
            variant="standard"
            fullWidth
            sx={{marginTop: 8}}
            />

            <Button
                    onClick={() => navigate('/r1')} 
                    fullWidth
                    variant="contained"
                    size="large"
                    sx={{mt: 2}}
                    >
                        로그인
                    </Button>
        </Container>

    </Container>
    );
}
